  return (
    <div className="allWrapper">
      <div className="middle">
        <div className="login">
          <h1 className="title">Login</h1>
          <input id="username" className="field un" type="text" placeholder="Enter username"></input>
          <br></br>
          <input id="password" className="field pw" type="password" placeholder="Enter password"></input>
          <br></br>
          <button id="loginButton" className="button" onClick={(e)=>{
            setUsername(document.getElementById("username").value)
            setPassword(document.getElementById("password").value)
          }}>Login</button>
        </div>
      </div>
    </div>
  );
}

function handleLogin() {
  let username = document.getElementById("username").value
